import React, {useMemo} from "react";
import styled, {keyframes} from "styled-components";

type MainStarProps = {
    onClick: () => void;
};

const rotateAnimation = keyframes`
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
`;

const MainStarContainer = styled.div`
  width: 100%;
  height: auto;
  display: flex;
  cursor: pointer;
  justify-content: center;
  animation: ${rotateAnimation} 12s infinite linear;
`;

const MainStar: React.FC<MainStarProps> = ({onClick}) => {
    const svgContent = useMemo(() => (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
            viewBox="0 0 412 396"
            fill="none"
            style={{
                width: "100%",
                height: "auto",
            }}
        >
            <rect width="100%" height="100%" fill="url(#a)"/>
            <defs>
                <pattern id="a" width={1} height={1} patternContentUnits="objectBoundingBox">
                    <use xlinkHref="#b" transform="scale(.001)"/>
                </pattern>
                <image
                    xlinkHref="data:image/png;base64,"
                    id="b"
                    width={1000}
                    height={1000}
                />
            </defs>
        </svg>
    ), []);

    return (
        <MainStarContainer onClick={onClick}>
            {svgContent}
        </MainStarContainer>
    );
};

export default MainStar;


